  return (
    <>
      <h1>Review</h1>
      <h3>I am a {props.identityValue}</h3>
      <h3>Writing to my {props.whoValue}</h3>
      <h3> And I want to say...</h3>
      {props.messageValue}
      <Button type="prev" switchHandler={props.switchHandler} />
      <Button
        type="submit"
        switchHandler={props.switchHandler}
        name="message"
        formValue={messageAnswer}
      />
    </>
  );
};

export default Summary;
